import React, { Component } from 'react';
import { BrowserRouter as Router, Route, Switch } from "react-router-dom";
import Nav from "./components/Nav";
import './App.css';
import {Home} from "./Pages/Home";



const App = () =>
<Router>
  <div>
    <Nav />
    <Switch>
    <Route exact path="/" component={Home} />
    </Switch>


  </div>
</Router>;

export default App;
